import utils from "../styles/utils.module.css";

const Contact = () => {
  return (
    <section>
      <div className={utils.container}>
        <div>

        </div>
       
      </div>

      <style jsx>
        {`
          section {
            background: #f0fff4;
            color: #22543d;
            min-height: 100vh;
            text-align: center;
          }

          section > div{
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
          }
        `}
      </style>
    </section>
  );
};

export default Contact;
